import axios from 'axios'
export function getMemberList (params) {
  return axios({
    url: '/api/employee/page',
    method: 'get',
    params
  })
}

// 修改---启用禁用接口
export function enableOrDisableEmployee (params) {
  return axios({
    url: '/employee',
    method: 'put',
    data: { ...params }
  })
}

// 新增---添加员工
export function addEmployee (params) {
  return axios({
    url: '/employee',
    method: 'post',
    data: { ...params }
  })
}

// 修改---添加员工
export function editEmployee (params) {
  return axios({
    url: '/employee',
    method: 'put',
    data: { ...params }
  })
}

// 修改页面反查详情接口
export function queryEmployeeById (id) {
  return axios({
    url:`/employee/${id}`,
    method: 'get'
  })
}
